$(document).ready(()=>{if(window.innerWidth>1024){$("html").css("overflow-y","hidden");let e=!1;$(window).bind("mousewheel DOMMouseScroll MozMousePixelScroll",n=>{delta=parseInt(n.originalEvent.wheelDelta||-n.originalEvent.detail);if(console.log(window.innerHeight),!e)if(e=!0,delta>=0){let n=0;const i=setInterval(()=>{window.scrollBy(0,n+5<=window.innerHeight?-5:-(window.innerHeight-n)),(n+=5)>=window.innerHeight&&(e=!1,clearInterval(i))},1)}else{let n=0;const i=setInterval(()=>{window.scrollBy(0,n+5<=window.innerHeight?5:window.innerHeight-n),(n+=5)>=window.innerHeight&&(e=!1,clearInterval(i))},1)}})}});